import React from 'react';
import { Route, Routes } from 'react-router-dom';  // Update from Switch to Routes
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import Navbar from './components/Navbar';

const App = () => {
  return (
    <div>
      <Navbar />
      <Routes>  {/* Replaces Switch */}
        <Route path="/" element={<HomePage />} />  {/* Update from component to element */}
        <Route path="/login" element={<LoginPage />} />  {/* Update from component to element */}
        <Route path="/signup" element={<SignupPage />} />  {/* Update from component to element */}
      </Routes>
    </div>
  );
};

export default App;
